import React from "react";
import { Card } from "../../share-components/Cards/Card";
import styled from "styled-components";

class Homepage extends React.Component{
    render(){
        return(
        <div>

            <div>
                <Quote>Life is like a train station, if you miss your it just wait there will be another but do not ever stop. </Quote>
            </div>
            <div>
            <Card image="testing">UI/UX</Card>
            </div>
        </div>
        )
    }
}

export {Homepage}

const Quote = styled.h2`
width:50%;
`
